import React, { Fragment, useState } from 'react'
import { v4 as uuidv4 } from 'uuid'
export default function Home() {
  // Hook
  const [lists, setLists] = useState([
    { id: uuidv4(), url: require('../../assets/img/1.jpg'), title: '家居' },
    { id: uuidv4(), url: require('../../assets/img/1.jpg'), title: '家居' },
    { id: uuidv4(), url: require('../../assets/img/1.jpg'), title: '家居' },
    { id: uuidv4(), url: require('../../assets/img/1.jpg'), title: '家居' },
    { id: uuidv4(), url: require('../../assets/img/1.jpg'), title: '家居' },
  ])
  return (
    <div>
      <h1>首页</h1>
      <ul>
        {
          lists.map(item => {
            return (
              <li key={item.id}>

                {item.title}
              </li>
            )
          })
        }
      </ul>
    </div>
  )
}
